syntax = "proto2";

import "SHollowMapLevelExtData.proto";
message SHollowMapLevelItemData {
    required int32 hollowMapTemplateID = 1;
    required int32 stayMapLayer = 2;
    required bool isFinished = 3;
    repeated SHollowMapLevelExtData hollowMapLevelExtDatas = 4;
    required int64 enterTimeStamp = 5;
}
